import axios from 'axios';

const baseURL = 'http://localhost:8000'; // Replace this with your actual backend API URL

const ProjectService = {
    getProjects: async (userId) => {
        try {
            const response = await axios.get(`${baseURL}/students/projectBank/${userId}`);
            return response.data;
        } catch (error) {
            console.error('Error fetching projects:', error);
            throw error;
        }
    }
};

export default ProjectService;
